import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar';
import Page from './LandingPage/Page';
import 'bootstrap/dist/css/bootstrap.min.css';
import Appointment from './LandingPage/Appointment';
import GetAppointments from './LandingPage/pages/GetAppointments';

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        {/* The Switch ensures only one Route is rendered at a time */}
        <Switch>
          {/* Home Page */}
          <Route exact path="/" component={Page} />

          {/* Appointment Page */}
          <Route path="/appointment" component={Appointment} />

          {/* Admin Page (separate page for GetAppointments) */}
          <Route path="/admin" component={GetAppointments} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
